import React from 'react';
import Button from '@mui/material/Button';

const OperationButton = (props) => {
  return (
    <Button
    sx={{ flexBasis: '25%' }}
      variant="outlined"
      onClick={() => props.handler(props.code)}
      size="large"
    >
      {props.text}
    </Button>
  )
}

export default OperationButton;
